import React from "react";
import styles from './homePage.css';

export default function homePage() {
    return (
        <main className={styles.homePage}>
            <div className="navBar">
                <img src="/adrianLogo.svg" alt="Logo"/>
                <h1>Projects</h1>
            </div>
        </main>
    )
}
